      <div className="card">
        <div className="left">
          <h1>Hello World</h1>
          <p>
            Lorem ipsum dolor, sit amet consectetur adipisicing elit. Cum nobis
            dicta ad beatae atque mollitia, ea quisquam ipsum accusantium
            nostrum.
          </p>
